import React, { Component } from "react";
import Parks from "./parks.json";
import ParkComponent from "./parkcomponent.js";

class Home extends Component {
  constructor() {
    super();
  }

  render() {
    Parks.forEach(park => {
      console.log(park.name, park.images.url);
    });

    return (
      <div>
        <ParkComponent />
      </div>
    );
  }
}

export default Home;
